func testSubjectToManyAddOpDeposits(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a Subject
	var b, c, d, e Deposit

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, subjectDBTypes, false, strmangle.SetComplement(subjectPrimaryKeyColumns, subjectColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*Deposit{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, depositDBTypes, false, strmangle.SetComplement(depositPrimaryKeyColumns, depositColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	foreignersSplitByInsertion := [][]*Deposit{
		{&b, &c},
		{&d, &e},
	}

	for i, x := range foreignersSplitByInsertion {
		err = a.AddDeposits(ctx, tx, i != 0, x...)
		if err != nil {
			t.Fatal(err)
		}

		first := x[0]
		second := x[1]

		if a.ID != first.SubjectID {
			t.Error("foreign key was wrong value", a.ID, first.SubjectID)
		}
		if a.ID != second.SubjectID {
			t.Error("foreign key was wrong value", a.ID, second.SubjectID)
		}

		if first.R.Subject != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}
		if second.R.Subject != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}

		if a.R.Deposits[i*2] != first {
			t.Error("relationship struct slice not set to correct value")
		}
		if a.R.Deposits[i*2+1] != second {
			t.Error("relationship struct slice not set to correct value")
		}

		count, err := a.Deposits().Count(ctx, tx)
		if err != nil {
			t.Fatal(err)
		}
		if want := int64((i + 1) * 2); count != want {
			t.Error("want", want, "got", count)
		}
	}
}
